import { MetadataWSDL } from "./wsdl-types";
/**
 * Result of Metadata WSDL parser.
 *
 * @author Ondřej Kratochvíl
 */
export interface ParsedMetadataWSDL {
    complexTypes: ComplexType[];
    simpleTypes: SimpleType[];
}
/**
 * Parsed xsd complex type.
 *
 * @author Ondřej Kratochvíl
 */
export interface ComplexType {
    name: string;
    base?: string;
    elements: Element[];
}
/**
 * Parsed xsd simple type.
 *
 * @author Ondřej Kratochvíl
 */
export interface SimpleType {
    name: string;
    base?: string;
    enumerations?: string[];
}
/**
 * Parsed xsd element.
 *
 * @author Ondřej Kratochvíl
 */
export interface Element {
    name: string;
    type: string;
    isArray: boolean;
    isOptional: boolean;
}
/**
 * Parse Metadata WSDL.
 *
 * @param metadataWSDL - already parsed XML Metadata WSDL.
 *
 * @author Ondřej Kratochvíl
 */
export declare function parseMetadataWSDL(metadataWSDL: MetadataWSDL): ParsedMetadataWSDL;
